Профессиональное  жидкое моющее средство, содержащее ПАВ,  для предварительной и основной стирки  белого белья.
Для различных типов загрязнений. Используется в воде любой жесткости.
Состав:
Алкилалкоксилат  25%
Фетталалкохолкоксилат 25%
Бутилгликоль 25%
Дозировка: 3 мл на 1 кг сухого белья через специальное дозирующее устройство, исключительно в совокупности с другими моющими средствами согласно установленным программам обработки белья.
Уровень рН (20°С) –7,4
Средство в виде концентрата расфасовано в полиэтиленовые канистры объемом  20 кг, срок годности концентрата средства 4 года в невскрытой упаковке производителя.
Дозируется через  дозирующую систему, размерами 465х654х135мм, для одновременного обслуживания от 1-й до 4-х  свободно программируемых и непрограммируемых стиральных машин от 5-ти до 6-ти жидкими продуктами через один шланг.
Технические характеристики:
Смешивание продуктов производится в системе, подача готового моющего раствора непосредственно в машину.
В одной единице находятся блок питания, компьютер, машинный адаптер, контроллер наполняемости машины, верхняя часть насосов, «флейта» и электромагнитные клапана для подачи растворов в стиральные машины. Оснащение дистанционным управлением для непрограммируемых машин, контролем герметичности дозирующих шлангов, контролем подачи входящей воды, контролем уровня продуктов в канистрах, системой защиты от попадания концентрированных продуктов в водопровод свежей воды, сигнальной лампой оповещения о неполадках. Занесение программирования и величины дозировки с пульта управления. Комплектуется специальной подвесной системой для используемых в  дозирующей установке  продуктов, для обеспечения         санитарно гигиенических требований уборки помещений. Требуемое питание 230 В.
	Австрия'),
