(49952281,90,6,540,13466192,1,'01.13.22.130','Лимоны. Плоды среднего размера, желтого цвета, без порчи и гнили, соответствие действующему  ГОСТу.'),
(49952282,110,50,5500,13466192,1,'15.33.21.131','Смородина черная свежемороженная. Весовая.  Внешний вид: ягоды зрелые, чистые, без повреждений вредителями и болезнями. Запах и вкус: свойственный данному виду ягод, без постороннего запаха и привкуса. Цвет: однородный, свойственный данному виду ягод. Не допускается размораживание и повторное замораживание ягод.'),
(49951962,160,50,8000,13466192,1,'01.13.23.122','Черешня. Плоды помологического сорта, целые, свежие, чистые, здоровые, без излишней внешней влажности, без постороннего запаха и привкуса, с плодоножкой. Плоды однородные по степени зрелости, не зеленые, не перезревшие. Содержание токсичных элементов и пестицидов в вишне не превышает допустимые уровни установленные медико-биологическими требованиями и санитарными нормами качества'),
(49951963,98,50,4900,13466192,1,'01.13.23.112','Груши свежие,1 сорта. Плоды однородные по степени зрелости, но не зеленые и не перезрелые. Плоды типичные по форме и окраске для данного гомологического сорта, без повреждений вредителями и болезнями, с плодоножкой или без нее, без признаков морщинистости. Плоды целые, чистые, без постороннего запаха и привкуса, без излишней внешней влажности.'),
(49951964,110,18,1980,13466192,1,'15.33.25.110','Изюм. Без косточек, чистый, цвет характерный для изюма  от светло коричневого до коричневого. Без посторонних вкусов и запахов. Соответствие действующему  ГОСТу.'),
(49952023,125,18,2250,13466192,1,'15.33.25.121','Курага. Без косточек, с маслянистой поверхностью, без налета, посторонних вкусов и запахов. Не вымоченный. Соответствие действующему ГОСТу.'),
(49952024,45,850,38250,13466192,1,'01.13.23.111','Яблоки свежие. Среднего размера, без гнили. Плоды однородные по степени зрелости, но не зеленые и не перезрелые. Плоды типичные по форме и окраске для данного помологического сорта, без повреждений вредителями и болезнями, без признаков морщинистости. Плоды целые, чистые, без постороннего запаха и привкуса, без излишней внешней влажности.'),
(49952025,100,60,6000,13466192,1,'15.33.21.190','Брусника свежемороженая. Весовая.  Внешний вид: ягоды зрелые, чистые, без повреждений вредителями и болезнями. Запах и вкус: свойственный данному виду ягод, без постороннего запаха и привкуса. Цвет: однородный, свойственный данному виду ягод. При размораживании повторно не замораживается ягода.'),
(49952026,160,60,9600,13466192,1,'15.33.21.140','Вишня свежемороженая. Весовая. ягоды одного помологического сорта, зрелые, чистые, без повреждений сельскохозяйственными вредителями. Цвет - однородный, свойственный данному виду свежих плодов и ягод в потребительской стадии зрелости'),
(49952173,300,30,9000,13466192,1,'01.13.23.132','Малина. Плоды малины собраны в период созревания, освобождены от цветоножек и конусовидного цветоложа. Плоды сборные - сложные костянки округлой или конусовидной формы, не слипшиеся в комки. Состоят из большого числа отдельных сросшихся между собой костянок. Размер ягоды: средний, крупный. Отдельные костянки мелкие, шаровидные или эллипсовидные, внутри с косточкой, имеющей ямчатую поверхность. Цвет поверхности: серовато-малиновый. Цвет мякоти: розовый. Цвет косточек: темно-желтый. Вкус: кисловато-сладкий'),
(49952174,65,100,6500,13466192,1,'01.13.22.120','Мандарины.Плоды свежие,чистые, без механических повреждений, без повреждений вредителями и болезнями, с ровно срезанной у основания плода плодоножкой. Без постороннего запаха и привкуса.Окраска плода светло-оранжевая, оранжевая. Мандарины1 категории.'),
(49952175,95,20,1900,13466192,1,'01.13.23.123','Нектарин. Плоды свежие, здоровые, гладкие, чистые, достаточно развившиеся, в стадии товарной зрелости, не перезревшие, не поврежденные, без затрагивающих мякоть повреждений насекомыми-вредителями, без трещин у основания черешков, типичной для данного сорта формы и окраски, без излишней внешней влажности. Без постороннего запаха и привкуса. Размер плода средний, большой.'),
(49952210,35,30,1050,13466192,1,'01.13.23.124','Слива. Плоды одного помологического сорта, развившимися, целые, чистые, здоровые, без излишней внешней влажности, зрелые без постороннего запаха и привкуса.'),
