(49952212,145,10,1450,13466192,1,'15.33.25.122','Чернослив. Без косточек, с маслянистой поверхностью, без налета, посторонних вкусов и запахов. Не вымоченный. Соответствие действующему  ГОСТу.'),
(49952213,95,100,9500,13466192,1,'01.13.23.123','Персик. Плоды каждого товарного сорта должны быть одного помологического сорта, вполне развившимися, целыми, чистыми, здоровыми, без излишней внешней влажности, зрелыми, без постороннего запаха и привкуса. Плоды однородные по степени зрелости, но не зеленые и не перезревшие. Содержание токсичных элементов и пестицидов в персиках не должно превышать допустимые уровни, установленные медико-биологическими требованиями и санитарными нормами.'),
